#!/usr/bin/env python3\n\"\"\"\nSimple Warehouse Debug\n\nThis script just checks if we can create a warehouse map and see its basic properties.\n\"\"\"\n\nprint(\"Starting warehouse debug...\")\n\ntry:\n    from warehouse.map import WarehouseMap\n    print(\"WarehouseMap imported successfully\")\n    \n    print(\"Creating warehouse map...\")\n    warehouse_map = WarehouseMap()\n    print(f\"Warehouse created: {warehouse_map.width}x{warehouse_map.height}\")\n    \n    print(\"Checking grid...\")\n    print(f\"Grid shape: {warehouse_map.grid.shape}\")\n    print(f\"Grid type: {type(warehouse_map.grid)}\")\n    \n    # Count cell types\n    import numpy as np\n    unique, counts = np.unique(warehouse_map.grid, return_counts=True)\n    for cell_type, count in zip(unique, counts):\n        print(f\"Cell type {cell_type}: {count} cells\")\n    \nexcept Exception as e:\n    print(f\"Error: {e}\")\n    import traceback\n    traceback.print_exc()\n\nprint(\"Debug complete.\")\n 